import Layout from '../Components/Layout';
import Link from 'next/link'

const PostLink = props => (
  <li>
    <Link
      href="/p/[id]"
      as={`/p?id=${props.id}`}>
      <a>{props.id}</a>
    </Link>
  </li>
)

export default function Index() {
  return (
    <div>
      <Layout>
        <h1>My Blog</h1>
        <ul>
          <PostLink id="hello next.js" />
          <PostLink id="next.js is awesome" />
          <PostLink id="Deploy apps with Zeit" />
        </ul>
      </Layout>
    </div>
  );
}
